<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Feliz San Valent√≠n</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            font-size: 20px;
            font-family: Arial, sans-serif;
            color: #2c1810;
            overflow: auto;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background-image: url('data:image/png;base64,');
            background-size: cover;
            background-position: center;
            background-repeat: no-repeat;
            background-attachment: fixed;
        }

        body::before {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: rgba(255, 255, 255, 0.75);
            z-index: 0;
        }

        .container {
            text-align: center;
            padding: 20px;
            position: relative;
            z-index: 1;
            max-width: 900px;
        }

        .title {
            font-size: 32px;
            margin-bottom: 20px;
            font-weight: bold;
            color: #d63384;
            text-shadow: 2px 2px 4px rgba(255, 255, 255, 0.9);
            line-height: 1.3;
        }

        .message {
            font-size: 18px;
            margin-bottom: 30px;
            line-height: 1.8;
            max-width: 700px;
            margin-left: auto;
            margin-right: auto;
            background: rgba(255, 255, 255, 0.95);
            padding: 25px;
            border-radius: 15px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            text-align: justify;
        }

        .gif-container {
            margin: 30px auto;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .gif-container img {
            max-width: 400px;
            width: 100%;
            height: auto;
            border-radius: 20px;
            box-shadow: 0 8px 16px rgba(0, 0, 0, 0.2);
            background: white;
            padding: 10px;
        }

        .timeline {
            margin-top: 40px;
            padding: 20px;
            background: rgba(255, 255, 255, 0.95);
            border-radius: 15px;
            max-width: 500px;
            margin-left: auto;
            margin-right: auto;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .timeline-item {
            margin: 15px 0;
            padding: 15px;
            background: linear-gradient(135deg, #ffeef8 0%, #ffe0f0 100%);
            border-radius: 10px;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
            border-left: 4px solid #d63384;
        }

        .timeline-date {
            font-weight: bold;
            color: #d63384;
            font-size: 20px;
        }

        .timeline-description {
            margin-top: 5px;
            font-size: 16px;
            color: #5c4033;
        }

        .countdown-container {
            margin-top: 25px;
            padding: 15px;
            background: rgba(255, 255, 255, 0.95);
            border-radius: 12px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            max-width: 500px;
            margin-left: auto;
            margin-right: auto;
        }

        .countdown-label {
            font-size: 18px;
            margin-bottom: 10px;
            color: #5c4033;
            font-weight: 600;
        }

        .countdown {
            font-size: 24px;
            font-weight: bold;
            color: #d63384;
            text-shadow: 1px 1px 2px rgba(255, 255, 255, 0.8);
        }

        @media (max-width: 768px) {
            .title {
                font-size: 24px;
            }
            
            .message {
                font-size: 16px;
                padding: 20px;
            }
            
            .gif-container img {
                max-width: 300px;
            }
            
            .countdown {
                font-size: 18px;
            }
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="title">Feliz San Valent√≠n/14 de febrero amor üíï</div>
        
        <div class="message">
            Este d√≠a es especial para todas las personas, ya que es el d√≠a del amor y la amistad es decir San Valent√≠n, el cual es el d√≠a en el cual recordamos con m√°s cari√±o a las personas que amamos y queremos en este d√≠a especial a pesar de la distancia amor, te deseo un feliz San Valent√≠n y que pasemos m√°s festividades juntos a pesar de la distancia que un d√≠a dejar√° de ser un problema, sin nada m√°s que decirte amor, Lucas, Feliz San Valent√≠n üíï te amo
        </div>

        <div class="gif-container">
            <img src="data:image/gif;base64," alt="Amor">
        </div>

        <div class="timeline">
            <div class="timeline-item">
                <div class="timeline-date">üìÖ 17 de Enero, 2025</div>
                <div class="timeline-description">El d√≠a que nos conocimos</div>
            </div>
            <div class="timeline-item">
                <div class="timeline-date">üíë 23 de Diciembre, 2025</div>
                <div class="timeline-description">El d√≠a que nos hicimos pareja</div>
            </div>
        </div>

        <div class="countdown-container">
            <div class="countdown-label">‚è∞ Tiempo desde que nos conocimos:</div>
            <div class="countdown" id="countdown-met"></div>
        </div>

        <div class="countdown-container">
            <div class="countdown-label">üíù Tiempo desde que somos pareja:</div>
            <div class="countdown" id="countdown-couple"></div>
        </div>
    </div>

    <script>
        function updateCountdown() {
            const now = new Date();
            
            const metDate = new Date('2025-01-17T00:00:00');
            const diffMet = now - metDate;
            
            const daysMet = Math.floor(diffMet / (1000 * 60 * 60 * 24));
            const hoursMet = Math.floor((diffMet % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
            const minutesMet = Math.floor((diffMet % (1000 * 60 * 60)) / (1000 * 60));
            const secondsMet = Math.floor((diffMet % (1000 * 60)) / 1000);
            
            document.getElementById('countdown-met').innerHTML = 
                `${daysMet} d√≠as ${hoursMet} horas ${minutesMet} minutos ${secondsMet} segundos`;
            
            const coupleDate = new Date('2025-12-23T00:00:00');
            
            if (now >= coupleDate) {
                const diffCouple = now - coupleDate;
                
                const daysCouple = Math.floor(diffCouple / (1000 * 60 * 60 * 24));
                const hoursCouple = Math.floor((diffCouple % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
                const minutesCouple = Math.floor((diffCouple % (1000 * 60 * 60)) / (1000 * 60));
                const secondsCouple = Math.floor((diffCouple % (1000 * 60)) / 1000);
                
                document.getElementById('countdown-couple').innerHTML = 
                    `${daysCouple} d√≠as ${hoursCouple} horas ${minutesCouple} minutos ${secondsCouple} segundos`;
            } else {
                const diffCouple = coupleDate - now;
                
                const daysCouple = Math.floor(diffCouple / (1000 * 60 * 60 * 24));
                const hoursCouple = Math.floor((diffCouple % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
                const minutesCouple = Math.floor((diffCouple % (1000 * 60 * 60)) / (1000 * 60));
                const secondsCouple = Math.floor((diffCouple % (1000 * 60)) / 1000);
                
                document.getElementById('countdown-couple').innerHTML = 
                    `Faltan ${daysCouple} d√≠as ${hoursCouple} horas ${minutesCouple} minutos ${secondsCouple} segundos ‚è≥`;
            }
        }

        updateCountdown();
        setInterval(updateCountdown, 1000);
    </script>
</body>
</html>